import React, { Component } from 'react';
import './App.css';
import BackgroundImage from "./media/background.jpg";
class App extends Component {
  render() {
    return (
      <div className="App" style={{backgroundImage:`url(${BackgroundImage})`,width:"100%"}}>

      </div>
    );
  }
}

export default App;
